import React from "react";
import styled from "styled-components";

const SidebarContainer = styled.div`
  width: 100xp;
  height: auto;
  float: left;
  z-index: 10;
  display: flex;
  color: grey;
  background-color: red;
`;

const Sidebar = () => {
  return <SidebarContainer>Hoi</SidebarContainer>;
};

export default Sidebar;
